// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

import Login from './pages/Login';
import Register from './pages/Register';
import RichiesteMie from './pages/RichiesteMie';
import Home from './pages/Committente'; // puoi cambiarlo in Dashboard, ecc.
import Navbar from './Navbar'; // opzionale, se hai una navbar
import PrivateRoute from './PrivateRoute'; // componente protettivo

function App() {
  return (
    <Router>
      <Navbar /> {/* se ce l'hai */}
      <Routes>
        {/* pubbliche */}
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* protette */}
        <Route
          path="/home"
          element={
            <PrivateRoute>
              <Home />
            </PrivateRoute>
          }
        />
        <Route
          path="/mie-richieste"
          element={
            <PrivateRoute>
              <RichiesteMie />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
